INSERT INTO `news` VALUES (7,'Atualização V0.3','<span id=\\\"docs-internal-guid-ebea7605-7fff-69d3-ff3f-1523304b9e5b\\\"><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Atualizações V0.3 (20/12/21)</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Pesca desativada até completarmos alguns testes</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Ditto Arrumado</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Colocado sistema de level separado do nick</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Arrumado nick system que atrapalhava o target</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Adicionado prêmio de  mais 4 quests (premios estão sendo revidos então a maioria dos baús do mapa estão sem nada, estamos revendo tudo e atualizando os baús em cada atualização)</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Removido mensagem ao entrar no chanel help até correção de algumas coisas</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Refeitos itens iniciais</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Facilitado base xp geral</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Automatização de donates do site implementada, agora a entrega de diamantes ao comprar pontos é feita 100% automática</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Evento bag corrigido, agora pode pegar somente um prêmio por evento</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Baby pikachu adicionado</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Arrumado catch system geral, refeita a fórmula, adicionado catch por perssistência e corrigido bugs (bug de queda e rollback e bug de quando tem 6 pokes e captutar um, não ir pro dp)</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Arrumado prêmios do daily items</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Revisto loot de todos os pokémons que dropavam stone, o drop de stones foi dificultado e padronizado</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Corrigido dano de todas as spells do servidor</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Colocado um auto reboot no servidor as 6:00 AM, para aplicar atualizações e otimização</span></p><div><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><br></span></div></span>','Numb',1653825764),(8,'Atualização V0.4','<span id=\\\"docs-internal-guid-c4ae99af-7fff-4d7c-6b19-4e024059b1c9\\\"><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">Atualização V0.4 (20/01)</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Adicionado mais de 6 hunts, uma quest e algumas correções e edições no mapa</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Correções no Ditto/Shiny Ditto</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Ativado e testado sistema de pesca</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Corrigido speed da bike</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Corrigido HeldBox</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Arrumado Full Restore</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Adicionado Sistema anti-bot (Vai ser ativado futuramente)</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Refeito sistema de catch, agora você tem uma quantidade máxima de balls que pode jogar em um determinado pokémon, essa quantidade equivale ao preço do pokememon, você gasta mais ou menos o preço dele em balls, em compensação ao novo sistema de média, agora o catch de sorte foi dificultado, para balanceamento no sistema</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Miss foi diminuido, de 50% de chance de um atk levar miss, agora são 15%</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Prêmios por level foram revistos e diminuidos</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Mensagem sobre o AutoLoot adicionada ao login</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Refeito balanceamento de XP</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Refeito balanceamento de level dos pokémons selvagens</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Revisto level que os pokémons precisavam para evoluir</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Revisto level das skills do Pikachu</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Removido Essence Shiny (conseguida apenas por eventos ou power ups agora) e Particle aura (Até adição do sistema de particle no client) do shop</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Arrumado DPS de cidades</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Adicionado teleports para se tornar cidadão das cidades</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Revisto surf e corrigido speed</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Arrumado tempo de !bug para um dia</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Arrumado teleport</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Adicionadas correções no Client, em breve colocaremos a Att no Launcher</span></p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\">- Feito client mobile, ainda em sua versão inicial, link já disponível no site</span></p><div><span style=\\\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\\\"><br></span></div></span>','Numb',1653825764),(10,'Atualização V0.5','Atualização V0.5 (20/02)<div><div>- Arrumada Shiny Stone</div><div>- Adicionado comando !comandos</div><div>- Adicionado comando !shinystone</div><div>- Adicionado comando !expbooster</div><div>- Adicionado comando !shinycharm</div><div>- Arrumado sistema de evolução, agora você pode evoluir seu pokémon em qualquer lugar que ele não buga mais...</div><div>- Arrumado uso de iscas infinitas</div><div>- Arrumado um bug crítico do Surf</div><div>- Arrumado pokemons pescados andarem em cima da agua</div><div>- Aumentado o range de click no mapa</div><div>- Arrumado bug crítico no autoLoot</div><div>- Adicionado Auto Stack itens, pra juntar sozinho tudo, seja ao arrastar pra bag ou fazer alguma quest</div><div>- Aumentado Speed de bikes</div><div>- Arrumado HeldBoxs</div><div>- Lista de pokemons shinys que aparecem aleatoriamente pelo mapa atualizada, agora todos os shinys que estão no servidor podem apareceer pelo mapa</div><div>- Colocado coowdown no revive</div><div>- Arrumado bug ao morrer no fly, surf</div><div>- Arrumado a abertura de box com 6 pokemons e o pokemon não ir pro dp</div><div>- Agora quando você cria conta o AutoLoot vem por padrão habilitado</div><div>- Algumas correções no Ditto/Shiny Ditto</div><div>- Adicionado sistema de torneio, feito todo dia às 15:00 e 20:00 horas</div><div>- Arrumado o PVP</div><div>- Arrumado item Butterfly wings</div><div>- Colocado efeito ao dropar Feather Stone</div><div>- Arrumado evolução do Larvitar</div><div>- Arrumado efeito da spell water gun</div><div>- Arrumado daily itens</div><div>- Adicionado area de TC, cheia de novas coisas como pvp, tasks e clans</div><div>- Adicionado stones no Henry, e diminuido preço de venda de stones no mesmo de 50 pra 25</div><div>- O máximo de cada bag que você pode comprar no mark agora é 20</div><div>- Arrumado alguns npcs</div><div>- Correções de algumas spells</div><div>- Agora não pode dar h1, h2 em zona segura</div><div>- Arrumado shop no mobile</div><div>- Janela de trade no mobile 50% arrumada</div></div>','Numb',1653825764),(11,'Atualização V0.6','<div>Atualização V0.6 (20/03)</div><div>- Substituído os 4 npcs de task do TC, mudado completamente o sistema</div><div>- Agora pokémons ganhos em qualquer box, são únicos</div><div>- Removido necessidade de Sun stone para bellossom</div><div>- Editado sistema de pesca, corrigido bugs, colocado uma proteção melhor contra bot, nerfado um pouco a quantidade dos pokemons pescados</div><div>- Adicionado evento darkrai</div><div>- Arrumado o pvp, além de ter adicionado área de pvp também corrigimos, para não perder mais XP quando morre</div><div>- Correções no Ditto e Shiny Ditto</div><div>- Facilitado o XP até o level 50</div><div>- CD dos pokemons iniciais divididos por 2, e buff em todos eles</div><div>- Adicionado torneio</div><div>- Editado o sistema de roupa de mergulho, agora os itens são conseguíveis atraves do npc Catch Token, localizado no segundo andar do tc</div><div>- Arrumado Megaphone</div><div>- Aumentado level de evolução de Metapod para 15</div><div>- Correções no order</div><div>- Adicionado Boost Stone e Guardian Shiny Gengar no Shop</div><div>- Nerf nas passivas do Golduck, Psyduck, Wobbuffet, Oddish, Gloom, Kabuto, Kabutops, Paras, Parasect, Venonat, Venomoth, Hopip, Skiploom, Jumpluff, Shiny Oddish, Shiny Venonat, Shiny Venomoth, Shiny Vileplume, Shiny Paras, Shiny Parasect e Shiny Tangela</div><div>- Buff nas passivas do Vileplume e Bellossom</div><div>- Arrumado preço do Electabuzz</div><div>- Adicionado sistema de Guardian (É um pokémon que, fora o seu pokémon principal te ajuda por determinado tempo, para os iniciais o shiny gengar amulet, embora seja de uso único, ajuda muito) similar ao sistema de card da pxg</div><div>- Agora, pra evoluir um pokémon por stone, ele pega o level necessário de evoluir por level e divide por dois</div><div>- Balanceamento na Boost Stone e Held Boost</div><div>- Nerfado Tier Lucky</div><div>- Arrumado Daily items</div>','Numb',1653825764),(12,'Atualização V0.7','<div>Atualização V0.7 (20/04)</div><div>- Adicionado Sistema AntiBot</div><div>- Correções na Shiny Stone</div><div>- Várias correções e coisas novas no cliente, que irão vir assim que o launcher novo chegar</div><div>- Adicionado prêmio em todos os baús do mapa, ao todo mais de 20 quests desbloqueadas</div><div>- Revisto prêmio das Daily Tasks</div><div>- Correções na VBall</div><div>- Correções no sistema de evolução</div><div>- Refeito o MoveSet de todos os pokémons</div><div>- Refeito a força dos moves dos pokémons, foi diminuída bastante por conta de termos reduzido muito o CD das magias</div><div>- Balanceamento nas passivas gerais</div><div>- Arrumado o level do pokémon que não aparecia em algumas situações</div><div>- Adicionada FirstBox no shop</div><div>- Algumas correções e alterações no sistema de order</div><div>- Atualizada as sprites de diversos pokémons, corpos e portraits</div><div>- Refeita PokeDex, a nova vai vir quando o launcher novo chegar</div><div>- Refeito loot de todos os pokémons</div><div>- Refeito sistema de loot</div><div>- Adicionado um módulo de tempo de guardian (Uma janela que mostra o tempo que seu guardian ainda tem)</div><div>- Refeito efeitos de drop de stones</div><div>- Daily reward desativado temporariamente</div><div>- Movebar some ao seu pokemon morrer</div><div>- Alterações no sistema de Idle (ser deslogado se parado por muito tempo)</div><div>- Prêmios por level alterados</div><div>- Balanceamento no XP</div><div>- Adicionado muitos itens de loot novos</div><div>- Edições no sistema de guardian</div><div>- Correções no Shiny Ditto</div><div>- Correções na roupa de mergulho</div><div>- Edições no Mark e Hugh</div><div>- Correções no AutoLoot</div><div>- Adição de alguns comandos novos</div><div>- Correções na PokeBar</div><div>- Atualizações no mapa, adição de quests, hunts e correções de bugs</div>','Numb',1653825764),(15,'Diamond Green Event','<div>Boa noite a todos, venho anunciar que o servidor será aberto as 13:00 de hoje, dia 29/05. </div><div>Para comemorar o lançamento do servidor vamos deixar um evento rolando por duas semanas!</div><div>O evento chama Diamond Green Event, todos os pokémons do servidor estão dropando um diamante verde por tempo limitado, esse diamante pode ser negociado em um npc que está localizado no TC. Aproveitem  evento!!</div><div><br></div><div><img src=\'https://i.imgur.com/F7MX3f7.jpg\\\'/></div>','Numb',1653825764),(16,'Atualização V1.0 (04/06)','<div><span style=\"background-color: transparent; font-size: 14px;\">- Desativada Shiny Stone</span></div><div>- Arrumadas HeldBoxs 1 à 4</div><div>- Refeito sistema completo de Catch, agora ele é feito por persistência e sorte, a cada ball que você joga te dá pontos para o sistema de persistência, com a poke tendo 1 ponto, great 2, super 3 e ultra 5. A Vball tem originalmente 4 pontos, mas ao jogar no shiny ela sobe pra 8, quanto mais pontos você tiver maior a sua chance de catch. Obviamente tem valores máximos para captura da maioria dos pokémons</div><div>- Refeito sistema completo de XP, incluindo a tabela de xp de cada poke em particular, estava horrível, tinha poke que dava muito e poke que dava muito pouco comparado a sua força, isso foi balanceado. O sistema em si sofreu várias modificações também</div><div>- Adicionado XP quando da catch pela primeira vez e catch window, também na primeira vez, mostrando quantas balls você jogou até capturar</div><div>- A pesca agora varia entre 2 e x segundos (min 8, depende da isca) o segundo efeito de pesca, que é quando você puxa o peixe da isca. Você agora tem um pouco menos de 2 segundos para puxar a isca de volta, tornando muito difícil o uso de bots de pesca</div><div>- Arrumado Autoloot, agora ele pega o loot na última bag com ao menos um slot livre, e se nenhuma bag tiver espaço nenhum vai pra bag principal</div><div>- Adicionadas mais 8 quests pelo mapa, adicionados prêmios na maioria dos baús</div><div>- Arrumado xp ao matar poke junto</div><div>- Editados prêmios de level</div><div>- Nerfado um pouco a aparição de shinys</div><div>- Editados os leveis que os pokes aparecem no mapa</div><div>- Evento Darkrai desativado temporariamente</div><div>- Evento Invasão ativado</div><div>- Diminuída chanches da passiva spores reaction e absorb</div><div>- Arrumada dex nos Shinys</div><div>- Arrumado erro no logoult tendo Farfetch\'d</div><div>- Diminuido level que os pokes vem quando ganha em box</div><div>- Colocado prêmios do PowerUp agora como unique item</div><div>- Aumentado um pouco a rate de loot</div><div>- Editados prêmios do evento bag</div><div>- Diminuído coowdown das spells no geral (se houver alguma spell com status negativo tipo confusion, sem cd depois que acaba o status peço que reportem o poke e a spell)</div><div>- Teleports do !h arrumados </div><div>- Diminuido hp de players</div><div>- Arrumado as bordas de praias no qual impossibilitava o surf</div><div>- Adicionado + 5 power ups no mapa</div><div>- Refeito o loot de todos os pokes shiny</div><div>- Arrumadas algumas spells sem dano</div>','Fallcon',1654537701);
