INSERT INTO `znote_news` VALUES (3,'Média de Balls','<span style=\"color: var(--font-color);\"><font size=\"4\">Como muitos pediram, iremos liberar a média de pokebolas necessárias para capturar cada pokémon.</font></span><br><div><span style=\"color: var(--font-color);\"><font size=\"4\"><br></font></span></div><div style=\"text-align: center;\"><font size=\"4\"><a href=\"http://pokemonhp.xyz/medias.php\" title=\"\" target=\"_blank\">Média de balls</a></font></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"https://i.imgur.com/nndL0Kk.png\" alt=\"\" align=\"none\"><br></div>',1685820554,209),(4,'Atualização 05/06','<div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">📢 Atualização de Recursos! 🎮🔥</span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Olá, treinadores! Temos ótimas notícias para compartilhar com vocês! 🌟 Estamos entusiasmados em anunciar as mais recentes notas de atualização do nosso amado jogo Pokémon HP. Preparamos algumas mudanças incríveis que certamente vão aprimorar sua experiência de jogo. Confira os destaques:</span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">1️⃣ Sistema de Captura Aprimorado 📸: Agora, nosso sistema funciona de uma forma mais dinâmica, você pode encontrar mais detalhes sobre a atualização na publicação anterior ou no changelog de nosso site!</span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">2️⃣ Sistema de Loot Automático 💎💰: A partir de agora, você não precisará mais vasculhar manualmente o inventário de um Pokémon derrotado. O novo sistema de loot automático fará o trabalho pesado para você! Basta clicar no corpo do Pokémon derrotado e todas as recompensas serão automaticamente adicionadas ao seu inventário. Coletar itens raros nunca foi tão fácil!</span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">3️⃣ Atualizações no nosso site 🌐: Não esqueça de visitar nosso site oficial para ficar por dentro de todas as novidades, eventos e atualizações futuras do jogo Pokémon HP. Lá você encontrará dicas valiosas, informações sobre eventos especiais e poderá se conectar com outros treinadores apaixonados pelo jogo. Acesse agora mesmo e embarque nessa jornada!</span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Lembre-se de manter conectado para aproveitar todas as melhorias e recursos adicionados. Boas aventuras, treinadores! 🌟🌍⚡️</span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><br></div><span class=\"xv78j7m\" spellcheck=\"false\"><div style=\"text-align: center;\"><span class=\"xv78j7m\" spellcheck=\"false\" style=\"color: var(--font-color);\">#PokémonHP</span><span style=\"color: var(--font-color);\"> </span><span class=\"xv78j7m\" spellcheck=\"false\" style=\"color: var(--font-color);\">#AtualizaçãoDeRecursos</span></div></span><div style=\"text-align: center;\"><br></div><div><div style=\"text-align: center;\"><img src=\"https://scontent.frez3-1.fna.fbcdn.net/v/t39.30808-6/352327217_582524300618849_3547448309119106170_n.jpg?_nc_cat=101&amp;ccb=1-7&amp;_nc_sid=730e14&amp;_nc_eui2=AeFzrUECsnKYyhuEf9-cMBiOAY3EFl_XunwBjcQWX9e6fL-TnUGC0uX_ZIMDANxUhA_Cwj2FLQ_R2CvEnGAMix_J&amp;_nc_ohc=O_9Oc3F89uYAX9XXm8s&amp;_nc_ht=scontent.frez3-1.fna&amp;oh=00_AfAyXo8XpAYwXZXhWSsYHg5hyDgBYnM34psdd1QaHPoNdw&amp;oe=648304A8\" alt=\"Pode ser uma imagem de texto que diz \" new=\"\" update\"\"=\"\" style=\"color: var(--font-color);\"></div><div style=\"text-align: center;\"><span class=\"xv78j7m\" spellcheck=\"false\"><br></span></div><div style=\"text-align: center;\"><span class=\"xv78j7m\" spellcheck=\"false\"><br></span></div></div>',1685983927,209),(5,'Capturas dos nossos Jogadores!','<div style=\"text-align: center;\"><br></div><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png&quot;); background-size: 16px 16px;\"><div style=\"text-align: center;\"><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🌟</span></span><span style=\"color: var(--font-color);\"> Atenção, Treinadores e Treinadoras! </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🌟</span></span></div></span><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Temos uma notícia incrível para compartilhar com todos vocês! </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t2/1/16/1f60d.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">😍</span></span><span style=\"color: var(--font-color);\"> Alguns Pokémon shiny estão sendo capturados neste exato momento! </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t8c/1/16/1f389.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🎉</span></span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t8c/1/16/1f389.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🎉</span></span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t8c/1/16/1f389.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🎉</span></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">E a melhor parte é que queremos que vocês, nossos treinadores dedicados, compartilhem suas conquistas brilhantes conosco! </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t13/1/16/1f308.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🌈</span></span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tf4/1/16/2728.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">✨</span></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Então, se você conseguiu capturar um Pokémon shiny recentemente e quer mostrar ao mundo seu feito impressionante, estamos convidando todos vocês a enviarem suas capturas para nós através do nosso Discord oficial. </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tde/1/16/1f4f8.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">📸</span></span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t2f/1/16/1f3ae.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🎮</span></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Junte-se a nós nessa aventura e faça parte da nossa comunidade Pokémon apaixonada e vibrante. É simples: basta acessar o link do nosso Discord e compartilhar suas imagens e histórias relacionadas a essas criaturas raras. </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1/16/1f4e9.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">📩</span></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Link do Discord: </span><a href=\"https://discord.gg/9EWeQMst5A\" class=\"x1fey0fg xmper1u x1edh9d7\">https://discord.gg/9EWeQMst5A</a></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Estamos ansiosos para ver todas as suas capturas reluzentes e mostrar ao mundo a habilidade dos nossos treinadores brilhantes! </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/ted/1/16/1f4ab.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">💫</span></span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tf4/1/16/2728.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">✨</span></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Lembre-se de respeitar as regras e ser cortês com os outros membros da comunidade Pokémon. Queremos que nosso Discord seja um espaço acolhedor e divertido para todos. </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t64/1/16/1f91d.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🤝</span></span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t6c/1/16/1f499.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">💙</span></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Aproveite essa oportunidade de se destacar e compartilhar suas conquistas brilhantes com a comunidade Pokémon. Vamos fazer juntos um show de brilho e cor! </span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">💥</span></span><span class=\"x1xsqp64 xiy17q3 x1o6pynw x19co3pv xdj266r xcwd3tp xat24cr x39eecv x2b8uid\" data-testid=\"emoji\" style=\"color: var(--font-color); cursor: default; background-image: url(&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png&quot;); background-size: 16px 16px;\"><span class=\"xexx8yu xn5pp95 x18d9i69 x2fxd7x x1yqt14a x1bhl96m\">🌟</span></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Atenciosamente,</span></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Equipe </span><span class=\"xv78j7m\" spellcheck=\"false\" style=\"color: var(--font-color);\">Pokémon HP</span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"https://i.imgur.com/Rg3S1pr.jpg\" width=\"832\"><br></div><div style=\"text-align: center;\"><br></div>',1686100132,209),(6,'Bugs Resolvidos - 08/06','<div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span class=\"hljs-bullet\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: Consolas, &quot;Andale Mono WT&quot;, &quot;Andale Mono&quot;, &quot;Lucida Console&quot;, &quot;Lucida Sans Typewriter&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Liberation Mono&quot;, &quot;Nimbus Mono L&quot;, Monaco, &quot;Courier New&quot;, Courier, monospace; font-size: 14px; vertical-align: baseline; outline: 0px; color: rgb(242, 204, 96); text-align: left; white-space-collapse: preserve;\">1.</span><span style=\"color: rgb(219, 222, 225); font-family: Consolas, &quot;Andale Mono WT&quot;, &quot;Andale Mono&quot;, &quot;Lucida Console&quot;, &quot;Lucida Sans Typewriter&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Liberation Mono&quot;, &quot;Nimbus Mono L&quot;, Monaco, &quot;Courier New&quot;, Courier, monospace; font-size: 14px; text-align: left; white-space-collapse: preserve; background-color: rgb(43, 45, 49);\"> Corrigimos o efeito de drop das stones nos pokémons\r\n</span><span class=\"hljs-bullet\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: Consolas, &quot;Andale Mono WT&quot;, &quot;Andale Mono&quot;, &quot;Lucida Console&quot;, &quot;Lucida Sans Typewriter&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Liberation Mono&quot;, &quot;Nimbus Mono L&quot;, Monaco, &quot;Courier New&quot;, Courier, monospace; font-size: 14px; vertical-align: baseline; outline: 0px; color: rgb(242, 204, 96); text-align: left; white-space-collapse: preserve;\">2.</span><span style=\"color: rgb(219, 222, 225); font-family: Consolas, &quot;Andale Mono WT&quot;, &quot;Andale Mono&quot;, &quot;Lucida Console&quot;, &quot;Lucida Sans Typewriter&quot;, &quot;DejaVu Sans Mono&quot;, &quot;Bitstream Vera Sans Mono&quot;, &quot;Liberation Mono&quot;, &quot;Nimbus Mono L&quot;, Monaco, &quot;Courier New&quot;, Courier, monospace; font-size: 14px; text-align: left; white-space-collapse: preserve; background-color: rgb(43, 45, 49);\"> Foi corrigido o bug onde as stones não eram coletadas pelo auto loot</span><br></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"https://i.gyazo.com/b4240bf909052a009f38805f7615c2b3.gif\" alt=\"\" align=\"none\" style=\"color: var(--font-color);\"></div>',1686254843,209),(7,'OTIMIZAÇÃO NO ANDAR','<div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Olá Treinadores e Treinadoras! ✨🎮</span></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Temos uma ótima novidade para compartilhar com todos vocês: nosso sistema de andar passou por uma reformulação completa! Agora, caminhar em nosso mundo virtual será uma experiência ainda mais suave e prazerosa. 🚶‍♀️🚶‍♂️💨</span></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Nossa equipe dedicou tempo e esforço para otimizar essa funcionalidade, levando em consideração os feedbacks que recebemos de vocês, nossos queridos jogadores. Estamos ansiosos para que vocês experimentem essa melhoria incrível! 🙌🎉</span></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\">Então, peguem seus smartphones e embarquem nessa jornada repleta de aventuras e diversão! 📲⚡️</span></div><div style=\"text-align: center;\"><span style=\"color: var(--font-color);\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://i.gyazo.com/3917b0247bdd87369407f9b7926a7a21.gif\" alt=\"\" align=\"none\"><span style=\"color: var(--font-color);\"><br></span></div>',1686494914,209),(9,'Fim de Semana de Double XP','<div style=\"text-align: center;\">🌟⚡️ Atenção, Treinadores (as) ! ⚡️🌟</div><div style=\"text-align: center;\">🎉🎈 É com grande satisfação que anunciamos que a Double EXP está ativa neste fim de semana! 🎈🎉</div><div style=\"text-align: center;\">Aproveitem essa oportunidade única de elevar suas habilidades de treinador (a) a um nível totalmente novo! Com a Double EXP, você poderá ganhar o dobro de experiência por cada pokémon derrotado.</div><div style=\"text-align: center;\">🔥⚡️ Vamos juntos alcançar o topo! ⚡️🔥</div><div style=\"text-align: center;\">#pokemonhp #doubleexp #poketibia</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"https://i.gyazo.com/235029bc372d179d60cf70302b8fa5b5.gif\" alt=\"\" align=\"none\"><br></div><div style=\"text-align: center;\"><br></div><p style=\"text-align: left;\"><br></p>',1687720182,209);
